import React from 'react'

import { Line } from 'react-chartjs-2';

export default function Smallchart(props) {
    var hours=[];
    for(let i=0; i<props.histData;i++){
        hours[i]=i;
    }

    return (
        <div>
            <Line
                data={{
                    datasets: [{
                        labels: hours,
			            backgroundColor: 'rgb(0, 0, 255)',
			            borderColor: 'rgb(0, 0, 255)',
			            data: props.histData,
			            fill:false,
			            lineTension: 0,
			            pointRadius: 0
			        }
			      ]
                }}
                width={95}
                height={45}
            />
        </div>
    )
}
